<script>
const RADAR_IMAGE_VISIBLE_DURATION = 1 * 1000;

import { mapGetters } from "vuex";
export default {
  name: "ascii-radar",

  watch: {
    radarImages(newVal) {
      if (newVal.length && !this.visibleRadarImage) this.cycleRadarImages();
    },
  },

  data() {
    return {
      visibleRadarImage: null,
      visibleRadarImageIx: 0,
    };
  },

  computed: {
    ...mapGetters(["radarImages"]),

    parsedRadarImage() {
      if (!this.visibleRadarImage) return "";
      return this.visibleRadarImage.replace(/\s/g, "&nbsp;");
    },
  },

  methods: {
    cycleRadarImages() {
      if (!this.radarImages || !this.radarImages.length) return;

      const setRadarImage = () => {
        if (this.visibleRadarImageIx >= this.radarImages.length) {
          this.visibleRadarImageIx = 0;
          setTimeout(setRadarImage, 10 * 1000);
        } else {
          this.visibleRadarImage = (this.radarImages[this.visibleRadarImageIx] || "").replace(/\n/gi, "<br/>");
          this.visibleRadarImageIx++;
          setTimeout(setRadarImage, RADAR_IMAGE_VISIBLE_DURATION);
        }
      };

      setRadarImage();
      setTimeout(setRadarImage, RADAR_IMAGE_VISIBLE_DURATION);
    },
  },
};
</script>

<style lang="scss" scoped>
#ascii_radar {
  align-items: center;
  display: flex;
  justify-content: center;
  font-family: consolas;
  font-size: 2px;
  height: 100%;
  line-height: 2px;
  overflow: hidden;
  padding-left: 30%;
  position: relative;
  width: 100%;

  #map {
    position: relative;
  }

  #data {
    bottom: 0;
    left: 0;
    position: absolute;
    right: 0;
    top: 0;
  }
}
</style>
